import React from "react";
import Soundscapes from "../Soundscapes/Soundscapes";
import { Icon } from "@iconify/react/dist/iconify.js";
const NavOptions = ({
  triggerReset,
  intervalCount,
  sessionCount,
  hideIcons,
  openMeditation,
}) => {
  return (
    <div id="options" style={{ visibility: hideIcons ? "hidden" : "visible" }}>
      <Soundscapes hideIcons={hideIcons} />
      <Icon
        id="meditation"
        className="icon"
        icon="mdi:meditation"
        height={35}
        onClick={() => openMeditation()}
      />
      <Icon
        id="reset"
        className="icon"
        icon="ei:undo"
        height={35}
        onClick={() => triggerReset()}
      />
      <p style={{ marginRight: "10px" }}>Interval: {intervalCount}</p>
      <p>Session: {sessionCount}</p>
    </div>
  );
};

export default NavOptions;
